import React from 'react'
import {Card, CardBody, CardHeader, CardText} from 'reactstrap'

class listCategorie extends React.Component{
    state = {
        Annonces:[
            {id:1, title:"Location F1", description:"F1 en plein centre de belfort toutes cherges comprises"},
            {id:2, title:"Location F2", description:"F2 en plein centre de belfort toutes cherges comprises"},
            {id:3, title:"Location F3", description:"F3 en plein centre de belfort toutes cherges comprises"},
            {id:4, title:"Location F4", description:"F4 en plein centre de belfort toutes cherges comprises"},
        ]
    }   
    
    render(){
        return(
            <div className>
                {this.state.Annonces.map(annonces =>{
                    return(
                        <div>
                            <Card>
                                <CardBody>
                                    <CardHeader>{annonces.title}</CardHeader>
                                    <CardText>{annonces.description}</CardText>
                                </CardBody>
                            </Card>
                        </div>
                    )
                })}
            </div>
        )
    }
}

export default listCategorie;
